import Image1 from "../../components/Image1/Image1";
import Image2 from "../../components/Image2/Image2";
import Image3 from "../../components/Image3/Image3";
import Datos from "../Datos/Datos";
export default function Destinos() {

    

    return (
      <>
        <div className="container my-3">
          <h1 className="titulo2">Desarrollo Web</h1>
          <div className="row">
            <div className="col ">
              <Image1 />
              <div className="col ">
                <div className="lugar">
                  {lugar.map((datos, index) => {
                    return <Datos key={index} titulo={datos.titulo} texto={datos.texto}></Datos>;
                  })}
                </div>
              </div>
            </div>
            <div className="row">
              <div className="col ">
                <Image2 />
                <div className="lugar1">
                  {lugar1.map((datos, index) => {
                    return <Datos key={index} titulo={datos.titulo} texto={datos.texto}></Datos>;
                  })}
                </div>
              </div>
              <div className="col ">
                <Image3 />
              </div>
            </div>
          </div>
        </div>
      </>
    );
}
